import React from 'react';
import Testimonial from "./Testimonial";

const Opinia_1 = {
    picture : './girl1.jpg',
    name : 'Ania',
    rating : 5,
    testimonial_text : 'Najlepsze wyjazdy, cudowni ludzie, niepowtarzalne wspomnienia!'
};

const Opinia_2 = {
    picture : './man1.jpg',
    name : 'Jacek',
    rating : 4,
    testimonial_text : 'Najlepsze wyjazdy, cudowni ludzie, niepowtarzalne wspomnienia!'
};

const Opinia_3 = {
    picture : './man2.jpg',
    name : 'Robert',
    rating : 5,
    testimonial_text : 'Najlepsze wyjazdy, cudowni ludzie, niepowtarzalne wspomnienia!'
};


class TestiWrapper extends React.Component {
    render () {
        return (
            <div>
                <Testimonial/>
            </div>
        )
    }
}

export default TestiWrapper;
